    @PostMapping("/refresh")
    public ResponseEntity<JwtDto> refresh(@RequestBody JwtDto jwtDto) throws ParseException {
    	
    	logger.info("  ");
    	logger.info("::::::::::::::::::INICIO:::::::::::::::::::::: ");
    	logger.info("refresh ");
    	 logger.info("Actual token "+jwtDto.getToken());
        String token = jwtProvider.refreshToken(jwtDto);
        
        logger.info("Nuevo token "+token);
        JwtDto jwt = new JwtDto(token);
        
        jwt.setRfc(jwtDto.getRfc());
        jwt.setCveIdUsuario(jwtDto.getCveIdUsuario());
        jwt.setNombreRazonSocial(jwtDto.getNombreRazonSocial());
        
        jwt.setNombreUsuario(jwtDto.getNombreUsuario() );
        jwt.setCurp(jwtDto.getCurp());
        
        jwt.setCodigo(1);
        jwt.setMensaje("√âxito");
        logger.info("::::::::::::::::::FIN:::::::::::::::::::::: ");
        logger.info("  ");
        return new ResponseEntity(jwt, HttpStatus.OK);
    }
